import { Link } from "react-router-dom";
import classes from './Nav.css';

function MainNavigation() {
	return (
		<header className={classes.navBar}>
			<div>Esau's Page</div>
			<nav>
				<ul>
					<li>
						<Link to="/">Home</Link>
					</li>
					<li>
						<Link to="/About">About</Link>
					</li>
				</ul>
			</nav>
		</header>
	);
}
export default MainNavigation;
